import WhiteBtn from '../Button/WhiteButton';
import Image from './Assets/img3.png';
import './Discount.css';

function Discount(){
    return (
        <div className="Discount">
            <div className="first-section">
                <img src={Image} />
            </div>
            <div className="two-section">
                <h2>Sale</h2>
                <h3>Enjoy up to <span>70%</span> off</h3>
                <p>Grab your limited offer of 70% off now and <br />enjoy the beauty of a glowing skin</p>
                <WhiteBtn />
            </div>
        </div>
    )
}

export default Discount;
